import React from "react";
import {
  ContentMenuHiden,
  ContentMenuHidenContainer,
  HeaderContainer,
  LOGOMenuHidenContainer,
  Menubar,
  MenubarHindend,
  MenuHidenContainer,
  OpacityContainer,
} from "../Header/style";
import Logo from "../Logo/index";

function Index() {
  return (
    <>
      <HeaderContainer>
        {/** Responsive by service have sreen from  900px to > 1200px*/}
        <Menubar />
        <OpacityContainer />
        <MenubarHindend />
      </HeaderContainer>
    </>
  );
}

export default Index;
